unused-classes.tester:
{
    display: flex;
    gap: 30px;
    align-items: center;
    flex-direction: row;
    padding: 30px 50px 30px 80px;
    width: fit-content;
    min-height: fit-content;
    position: static;
    min-width: fit-content;
}

unused-classes.suggestionMsgSection:
 {
  border-radius: 0.5 * $spacer;
  max-width: $suggestion-section-width;
  padding: 2 * $spacer;
  .engagementEntity {
    border: 0;
    .engagementEntityContent {
      padding: 0;
    }
  }
  .msgContent {
    .sprMedia {
      width: $msg-content-width;
      height: auto;
    }
  }
  .asset-card {
    padding: $asset-card-padding;
    width: $asset-card-width;
  }
  .samAssetLinkSec {
    padding: $link-asset-padding;
  }
  .textContainer {
    padding: $text-cont-padding;
  }
  .samPostUserSection {
    padding: $sam-post-user-section-padding;
  }
  .samAssetLink {
    margin-left: $link-margin;
  }
  .assetWrapper {

    border: unset;
    .assetView {
      .assetFooter {
        display: none;
      }
    }
  }
  .msgFooter {
    display: none;
  }
  .msgProfileName {
    font-size: $suggested-profile-name-font-size;
  }

  .msgHdrCont {
    margin-bottom: $suggested-content-hdr-spacing;
  }
}
